import React from "react";
import ReactAnimatedWeather from 'react-animated-weather';

export default function WeatherIcon(props) {
const codeMapping = {
    "01d": "CLEAR_DAY",
    "01n": "CLEAR_NIGHT",
    "02d": "CLEAR_DAY",
    "02n": "CLEAR_NIGHT",
    "03d": "CLEAR_DAY",
    "03n": "CLEAR_NIGHT",
    "04d": "CLEAR_DAY",
    "04n": "CLEAR_NIGHT",
    "09d": "CLEAR_DAY",
    "09n": "CLEAR_NIGHT",
    "10d": "CLEAR_DAY",
    "10n": "CLEAR_NIGHT",
    "11d": "CLEAR_DAY",
    "11n": "CLEAR_NIGHT",
    "13d": "CLEAR_DAY",
    "13": "CLEAR_NIGHT",
    "50d": "CLEAR_DAY",
};

    return  ( 
    <ReactAnimatedWeather
    icon={codeMapping[props.code]}
    color="pink"
    size={64}
    animate={true}
  />
);
}
